import React from "react";
import { Link, useNavigate } from "react-router-dom";
import logo from "../../images/logo.png";
import historyLogo from "../../images/history.png";

function NavBar() {
  const navigate = useNavigate();

  const handleClickLogo = () => {
    navigate("/history");
  };

  return (
    <nav className="bg-gray-800">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 h-20 flex items-center justify-between">
        <Link to="/" className="flex items-center" onClick={handleClickLogo}>
          <img src={logo} alt="Logo" className="h-32 w-32 mr-2" />
        </Link>
        <Link to="/history" className="flex items-center" onClick={handleClickLogo}>
          <img src={historyLogo} alt="History Logo" className="h-8 w-8" />
        </Link>
      </div>
    </nav>
  );
}

export default NavBar;
